<?phpnamespace Nemundo\WebLog\Page;use Nemundo\Admin\Com\Table\AdminTable;use Nemundo\Admin\Com\Table\AdminTableHeader;use Nemundo\Admin\Com\Table\Row\AdminTableRow;use Nemundo\WebLog\Data\BrowserAgent\BrowserAgentReader;use Nemundo\WebLog\Template\WebLogTemplate;class BrowserAgentPage extends WebLogTemplate{    public function getContent()    {        $table = new AdminTable($this);        $reader = new BrowserAgentReader();        $header = new AdminTableHeader($table);        $header->addText($reader->model->browserAgent->label);        $header->addText($reader->model->count->label);        foreach ($reader->getData() as $browserAgentRow) {            $row = new AdminTableRow($table);            $row->addText($browserAgentRow->browserAgent);            $row->addText($browserAgentRow->count);        }        return parent::getContent();    }}